import os
import ctypes
import base64
import tempfile
from tkinter import Tk, Button, Label, messagebox
from pygame import mixer
import winreg
import ctypes


class PatakaApp:
    def __init__(self, root):
        self.root = root
        self.root.title("Стать Патакой?")
        self.root.geometry("300x150")

        # Установка иконки приложения
        try:
            self.root.iconbitmap(self.resource_path("pataka.ico"))
        except:
            # Если иконка не найдена, создаём временную из Base64
            self.create_temp_icon()

        # Инициализация звуковой системы
        mixer.init()

        # Создаем интерфейс
        Label(root, text="Стать Патакой?", font=("Arial", 16)).pack(pady=20)
        Button(root, text="OK", command=self.become_pataka,
               width=10, height=2).pack()

        # Путь к встроенному изображению (замените на свой)
        self.wallpaper_path = self.extract_wallpaper()

    def extract_wallpaper(self):
        """Извлекает встроенное изображение обоев"""
        # Вставьте ваш Base64 код изображения между тройными кавычками
        BASE64_IMAGE = """"""

        if not BASE64_IMAGE.strip():
            return None

        try:
            image_data = base64.b64decode(BASE64_IMAGE)
            temp_file = tempfile.NamedTemporaryFile(
                delete=False, suffix=".jpg")
            temp_file.write(image_data)
            temp_file.close()
            return temp_file.name
        except:
            return None

    def play_sound(self):
        """Воспроизводит встроенный звук"""
        # Вставьте ваш Base64 код звука между тройными кавычками
        BASE64_SOUND = """"""

        if not BASE64_SOUND.strip():
            return

        try:
            sound_data = base64.b64decode(BASE64_SOUND)
            temp_file = tempfile.NamedTemporaryFile(
                delete=False, suffix=".wav")
            temp_file.write(sound_data)
            temp_file.close()

            mixer.music.load(temp_file.name)
            mixer.music.play()

            # Удаляем временный файл после воспроизведения
            os.unlink(temp_file.name)
        except Exception as e:
            print(f"Ошибка воспроизведения звука: {e}")

    def set_accent_color(self):
        try:
            # Красный цвет в формате BGR (0x0000FF)
            red_color = 0x00008B

            key = winreg.HKEY_CURRENT_USER
            sub_key = r"SOFTWARE\Microsoft\Windows\CurrentVersion\Explorer\Accent"

            # Открываем ключ реестра для записи
            with winreg.OpenKey(key, sub_key, 0, winreg.KEY_WRITE) as reg_key:
                # Устанавливаем цвет для меню
                winreg.SetValueEx(reg_key, "AccentColorMenu", 0,
                                  winreg.REG_DWORD, red_color)

                # Устанавливаем цвет для панели задач
                winreg.SetValueEx(reg_key, "StartColorMenu", 0,
                                  winreg.REG_DWORD, red_color)

            # Обновляем параметры системы
            ctypes.windll.user32.SystemParametersInfoW(0x0014, 0, None, 0)

            print("Цвета успешно изменены на красный!")
            return True

        except Exception as e:
            print(f"Ошибка изменения цветов: {e}")
            return False

    def set_wallpaper(self):
        """Устанавливает обои рабочего стола"""
        if self.wallpaper_path and os.path.exists(self.wallpaper_path):
            try:
                ctypes.windll.user32.SystemParametersInfoW(
                    20, 0, self.wallpaper_path, 3)
            except:
                pass

    def reboot_computer(self):
        """Выполняет перезагрузку компьютера"""
        try:
            # Для Windows
            if os.name == 'nt':
                os.system(
                    "shutdown /r /t 10 /c \"Патака перезагружает ваш компьютер! Применяем изменения...\"")
            # Для Linux/Mac (необязательно)
            else:
                os.system("sudo shutdown -r now")
        except Exception as e:
            print(f"Ошибка при перезагрузке: {e}")

    def create_temp_icon(self):
        """ Создаёт временную иконку из Base64 """
        ICON_BASE64 = """"""

        if ICON_BASE64.strip():
            try:
                icon_data = base64.b64decode(ICON_BASE64)
                temp_icon = tempfile.NamedTemporaryFile(
                    delete=False, suffix=".ico")
                temp_icon.write(icon_data)
                temp_icon.close()
                self.root.iconbitmap(temp_icon.name)
                os.unlink(temp_icon.name)
            except:
                pass

    def become_pataka(self):

        self.play_sound()
        self.set_wallpaper()
        self.set_accent_color()

        messagebox.showinfo(
            "Готово!", "Теперь вы Патака! Компьютер перезагрузится через 10 секунд.")
        self.root.destroy()

        # Запускаем перезагрузку
        self.reboot_computer()


if __name__ == "__main__":
    root = Tk()
    app = PatakaApp(root)
    root.mainloop()
